import React, { Component } from 'react'
import { View, Text, Image,Button,StyleSheet } from 'react-native'
 
class PetScreen extends Component {
   state = {
      data: ''
   }
   componentDidMount = () => {
    fetch('https://jsonblob.com/api/ef95fdc4-1ab1-11eb-84f5-11ae858035ac',  {
         method: 'GET'
      })
      .then((response) => response.json())
      .then((responseJson) => {
         console.log(responseJson);
         this.setState({
            data: responseJson
         })
      })
      .catch((error) => {
         console.error(error);
      });
   }
   render() {
      return (
         <View>
 <Image 
          style={{ width: '100px', height: '80px' ,alignItems:'center',justifyContent:'center'}}
          source={{uri:this.state.data.image}}
        />
            <Text>
              : {this.state.data.petName}
            </Text>
            <Text>
               : {this.state.data.petAge}
            </Text>
            <Text>
               {this.state.data.petLocation}
            </Text>
            <Text>
               {this.state.data.petBreed}
            </Text>
         </View>
      )
   }
}

export default PetScreen
